import ExpenseItem from './components/ExpenseItem';


function App() {

  const expenses = [
    { title: 'MAchinery Tools', amount: 2099.0, date: new Date(2021, 5, 24) },
    { title: 'Car Insurance', amount: 2099.0, date: new Date(2021, 5, 24) },
    { title: 'Painting cost', amount: 2099.0, date: new Date(2021, 5, 24) },
    { title: 'Transorming cost', amount: 2099.0, date: new Date(2021, 5, 24) }
  ]

return (
  <div>
    <h2>Let's get started!</h2>
    <ExpenseItem x={expenses[0].title} y={expenses[0].amount} z={expenses[0].date}></ExpenseItem>
    <ExpenseItem x={expenses[1].title} y={expenses[1].amount} z={expenses[1].date}></ExpenseItem>
    <ExpenseItem x={expenses[2].title} y={expenses[2].amount} z={expenses[2].date}></ExpenseItem>
    <ExpenseItem x={expenses[3].title} y={expenses[3].amount} z={expenses[3].date}></ExpenseItem>
  </div>
);
}

export default App;
